import React, { useContext } from 'react';
import s from './Navbar.module.css';
import { NavLink, Link } from 'react-router-dom';
import Cart from '../../assets/icons/Cart';
import logo from '../../assets/logo.png';
import MoodSwitcher from './MoodSwitcher/MoodSwitcher';
import Button from '../UI/Button/Button';
import Badge from '../UI/Badge/Badge';
import Heart from '../../assets/icons/Heart';
import { Context } from '../../context';
import Sales from '../../assets/icons/Sales';
import HomeIcon from '../../assets/icons/HomeIcon';
import Categories from '../../assets/icons/Categories';
import Products from '../../assets/icons/Products';
import Menuicon from '../../assets/icons/MenuIcon';

export default function Navbar({cart_number, wish_number, isMenuOpen, openMenu}) {
    const {isDarkMode, toggleTheme, isMobile} = useContext(Context)

    return (
        <div>
            {isMobile && <div className='w-10 h-10 cursor-pointer flex justify-end items-center' onClick={openMenu}><Menuicon /></div>}
            {isMenuOpen && isMobile &&
                <div className='relative'>
                    <div className={s.nav}>
                        <div className={s.left_part}>
                            <Link to={'/'}>
                                <HomeIcon /> Home page
                            </Link>
                            <Link to={'/categories'} className={s.categories_link}>
                                    <Categories /> Categories 
                            </Link>
                            <NavLink to={'/products'}>
                                    <Products />Products
                            </NavLink>
                            <NavLink to={'/sales'}>
                                <Sales /> Sales
                            </NavLink>
                            <NavLink to={'/wishlist'} className='relative'>
                                <Heart isDarkMode={isDarkMode} />Wishlist
                            </NavLink>
                        </div>
                    </div>   
                    <div className={s.top_line}>
                        <NavLink to={'/cart'} className='relative'>
                            <Cart isDarkMode={isDarkMode} />Cart
                            {cart_number > 0 && <Badge number={cart_number} />}
                        </NavLink>
                        <MoodSwitcher isDarkMode={isDarkMode} toggleTheme={toggleTheme} />
                        <div className='w-10 h-10 cursor-pointer flex justify-end items-center' onClick={openMenu}><Menuicon /></div>
                    </div>
                </div>
            }
            {!isMobile &&
                <div className={s.nav}>
                    <div className={s.left_part}>
                        <Link to={'/'}>
                            { isMobile ? 
                                <HomeIcon /> : 
                                <img src={logo} alt='logo' />
                            }
                        </Link>
                        <Link to={'/categories'} className={s.categories_link}>
                            { isMobile ? 
                                <Categories /> : 
                                <Button className='primary' name='Catalog'/> 
                            }
                        </Link>
                        <NavLink to={'/products'}>
                            { isMobile ? 
                                <Products /> : 
                                <Button className='primary' name='All products'/>
                            }
                        </NavLink>
                    </div>
                    <div className={s.right_part}>
                        <NavLink to={'/sales'}>
                            <Sales />
                        </NavLink>
                        <MoodSwitcher isDarkMode={isDarkMode} toggleTheme={toggleTheme} />
                        <NavLink to={'/wishlist'} className='relative'>
                            <Heart isDarkMode={isDarkMode} />
                            {wish_number > 0 && <Badge number={wish_number} />}
                        </NavLink>
                        <NavLink to={'/cart'} className='relative'>
                            <Cart isDarkMode={isDarkMode} />
                            {cart_number > 0 && <Badge number={cart_number} />}
                        </NavLink>
                    </div>
                </div>  
            }
        </div>
    );
}
